    console.log(event.target.outerText);
  };
  return (
    <>
      <KeyList>
        {tabs.keys.map((suffix) => {
          return (
            <KeyItem key={suffix} onClick={onClick}>
              {suffix}
            </KeyItem>
          );
        })}
      </KeyList>
    </>
  );
};
